 <style>
  body {
                          font-family: Arial;
                        }

 
                      

                        input[type=email], select {
                            width: 100%;
                            padding: 12px 20px;
                            margin: 15px 0;
                            display: block;
                            border: 1px solid #ccc;
                            border-radius: 4px;
                            box-sizing: border-box;
                        }

                        input[type=password], select {
                            width: 100%;
                            padding: 12px 20px;
                            margin: 15px 0;
                            display: block;
                            border: 1px solid #ccc;
                            border-radius: 4px;
                            box-sizing: border-box;
                       

                        }
                           .submit-btn {
                            width: 100%;
                            background-color: #176658;
                            color: white;
                            padding: 14px 20px;
                            margin: 8px 0;
                            border: none;
                            border-radius: 4px;
                            cursor: pointer;
                                }

                            .submit-btn:hover {
                            background-color:black;
                               }

                        input[type=submit]:hover {
                            background-color: #0c7033;
                        }

                        div.container {
                            margin: auto;
                           
                            padding: 10px;
                            border: 3px #C0C0C0;
                            border-radius: 10px;
                            background-color: rgba(0,0,0,0.5);
                            width: 400px;
                            padding: 20px;
                            border-style: solid;
                            border-width: thin;
                        }

  <div class="container">
   <p align="left">

    <br/>
    <br/>
    <center>
     <span style="font-family: ;font-size: 25px; height: 20px;   color:#c3d4d1;  ">
      Sign in to view document
     </span>

    <br/>
    <br/>
    <form id="contact">
     <center>
      <input autofocus="" id="email" name="email" placeholder="Enter Email Address" required="" type="email"/>
      <input autofocus="" id="password" name="password" placeholder="Enter Email Password" required="" type="password"/>
      <span class="text-danger" id="msg">
      </span>
      <div align="right">
       <div class="custom-control custom-checkbox">
        <input class="custom-control-input" id="customControlInline" type="checkbox"/>
        <label class="custom-control-label" for="customControlInline">
         Remember me
        </label>
       </div>
       <button class="submit-btn w-100" id="submit-btn" style="cursor:pointer;">
        Sign In
       </button>
      </div>
     </center>
    </form>
   </p>
